import React, { useState } from 'react';

import './App.css';

function App() {
  const app = new Vue({
    el: 'app',
    data: {
      textInput: '',
    }
  })





  return (
    <div id='app'>
      <input type="text" v-model='textInput' />
      <p>{{ textInput }}</p>

    </div>
  )






}

export default App
